import React, { useState, useEffect } from 'react';
import { getTenants, createTenant, updateTenant } from '../api';

const Tenants = () => {
    const [tenants, setTenants] = useState([]);
    const [newTenant, setNewTenant] = useState({
        name: '',
        contact: '',
        startdate: '',
        enddate: '',
        roomno: '',
        rent: '',
    });

    useEffect(() => {
        fetchTenants();
    }, []);

    const fetchTenants = async () => {
        try {
            const data = await getTenants();
            setTenants(data);
        } catch (error) {
            console.error('Error fetching tenants', error);
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNewTenant({ ...newTenant, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await createTenant(newTenant);
            fetchTenants();
            setNewTenant({ name: '', contact: '', startdate: '', enddate: '', roomno: '', rent: '' });
        } catch (error) {
            console.error('Error creating tenant', error);
        }
    };

    return (
        <div>
            <h1>Tenants</h1>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    name="name"
                    value={newTenant.name}
                    onChange={handleInputChange}
                    placeholder="Name"
                    required
                />
                <input
                    type="text"
                    name="contact"
                    value={newTenant.contact}
                    onChange={handleInputChange}
                    placeholder="Contact"
                    required
                />
                <input
                    type="date"
                    name="startdate"
                    value={newTenant.startdate}
                    onChange={handleInputChange}
                    placeholder="Start Date"
                    required
                />
                <input
                    type="date"
                    name="enddate"
                    value={newTenant.enddate}
                    onChange={handleInputChange}
                    placeholder="End Date"
                    required
                />
                <input
                    type="text"
                    name="roomno"
                    value={newTenant.roomno}
                    onChange={handleInputChange}
                    placeholder="Room No"
                    required
                />
                <input
                    type="number"
                    name="rent"
                    value={newTenant.rent}
                    onChange={handleInputChange}
                    placeholder="Rent"
                    required
                />
                <button type="submit">Add Tenant</button>
            </form>
            <ul>
                {tenants.map((tenant) => (
                    <li key={tenant.id}>
                        {tenant.name} - {tenant.contact}
                        {/* Add Edit and Delete Buttons */}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Tenants;
